--
-- Name: establec_inicial; Type: VIEW; Schema: padron; Owner: postgres
--

CREATE VIEW padron.establec_inicial AS
 SELECT inst.id_institucion,
    inst.cue,
    inst.cue_anexo,
    inst.nombre,
    inst.numero,
    inst.funcion,
    inst.region,
    loc.localidad,
    depa.departamento,
    niv.nombre AS nivel,
    string_agg(DISTINCT moda.nombre, ', '::text) AS modalidad,
    inst.domicilio,
    inst.cp,
    inst.ambito,
    inst.web,
    inst.tel
   FROM ((((((padron.institucion inst
     JOIN padron.departamento depa ON ((inst.id_departamento = depa.id_departamento)))
     JOIN padron.localidad loc ON ((inst.id_localidad = loc.id_localidad)))
     JOIN padron.oferta ofe ON ((ofe.id_institucion = inst.id_institucion)))
     JOIN padron.nivel niv ON ((niv.id_nivel = ofe.id_nivel)))
     JOIN padron.modalidades_educativas moda ON ((moda.id_modalidad = ofe.id_modalidad)))
     JOIN padron.educacion_tipo edu ON ((edu.id_institucion = inst.id_institucion)))
  GROUP BY inst.id_institucion, inst.cue, inst.cue_anexo, inst.nombre, inst.numero, inst.funcion, inst.region, loc.localidad, depa.departamento, niv.nombre, inst.domicilio, inst.cp, inst.ambito, inst.web, inst.tel
  ORDER BY inst.region, inst.numero;


