--
-- Name: establec_educativos; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.establec_educativos AS
 SELECT DISTINCT inst.id_institucion,
    inst.nombre,
    inst.numero,
    geo.geom,
    inst.region,
    loc.localidad,
    depa.departamento,
    niv.nombre AS nivel,
    inst.cue_anexo,
    dir.responsable,
    dir.email,
    dir.tel_resp,
    inst.web,
    inst.domicilio,
    inst.tel,
    inst.ambito,
    func.gestion,
    moda.nombre AS modalidad
   FROM ((((((((padron.institucion inst
     JOIN padron.georeferencia geo ON ((geo.id_institucion = inst.id_institucion)))
     JOIN padron.contacto dir ON ((dir.id_institucion = inst.id_institucion)))
     JOIN padron.oferta ofe ON ((ofe.id_institucion = inst.id_institucion)))
     JOIN padron.nivel niv ON ((niv.id_nivel = ofe.id_nivel)))
     JOIN padron.modalidades_educativas moda ON ((moda.id_modalidad = ofe.id_modalidad)))
     JOIN padron.funcionamiento func ON ((func.id_institucion = inst.id_institucion)))
     JOIN padron.localidad loc ON ((loc.id_localidad = inst.id_localidad)))
     JOIN padron.departamento depa ON ((depa.id_departamento = inst.id_departamento)));


ALTER TABLE public.establec_educativos OWNER TO postgres;

